tables.table_schema:
CREATE TABLE Neighborhood (
    neighborhood_id INT PRIMARY KEY,
    neighborhood_name VARCHAR(50) NOT NULL
);

CREATE TABLE PropertyLocation (
    property_id INT REFERENCES Property(property_id),
    location_name VARCHAR(50) NOT NULL,
    square_footage INT,
);

CREATE TABLE Neighborhoods (
  neighborhood_id INT PRIMARY KEY,
  neighborhood_name TEXT
);

CREATE TABLE AvgPricePerSqFt (
  avg_price_per_sqft_id INT PRIMARY KEY,
  neighborhood_id INT,
  average_price_per_sqft FLOAT
);

CREATE TABLE neighborhood (
    neighborhood_id INT PRIMARY KEY,
    name VARCHAR(255) NOT NULL
);

CREATE TABLE property (
    property_id INT PRIMARY KEY,
    neighborhood_id INT,
    price DECIMAL(10, 2) NOT NULL,
    square_footage INT NOT NULL
);

CREATE TABLE price_per_square_foot (
    price_id INT PRIMARY KEY,
    property_id INT,
    average_price_per_sqft DECIMAL(10, 2) NOT NULL
);

CREATE TABLE property_type (
    type_id INT PRIMARY KEY,
    property_id INT,
    type VARCHAR(255) NOT NULL
);

CREATE TABLE location (
    location_id INT PRIMARY KEY,
    property_id INT,
    latitude DECIMAL(8, 6) NOT NULL,
    longitude DECIMAL(9, 6) NOT NULL
);
